import React, { useState, useRef } from 'react';
import { useConversation } from '@elevenlabs/react';

const VoiceInterface = ({ onTranscript, onResponse }) => {
  const [isConnected, setIsConnected] = useState(false);
  const [status, setStatus] = useState('Click to start');

  const conversation = useConversation({
    onConnect: () => {
      console.log('‚úÖ Connected to ElevenLabs');
      setIsConnected(true);
      setStatus('Connected - Speak now!');
    },
    onDisconnect: () => {
      console.log('‚ùå Disconnected from ElevenLabs');
      setIsConnected(false);
      setStatus('Disconnected');
    },
    onMessage: (message) => {
      console.log('üì® Message received:', message);

      // Handle different message types
      if (message.message && message.message.role === 'user') {
        const transcript = message.message.content;
        console.log('üë§ User said:', transcript);
        onTranscript && onTranscript(transcript);
      } else if (message.message && message.message.role === 'assistant') {
        const response = message.message.content;
        console.log('ü§ñ Agent said:', response);
        onResponse && onResponse(response);
      }
    },
    onError: (error) => {
      console.error('‚ùå ElevenLabs error:', error);
      setStatus(`Error: ${error.message}`);
    },
  });

  const startConversation = async () => {
    try {
      setStatus('Connecting...');

      const agentId = process.env.REACT_APP_ELEVENLABS_AGENT_ID;

      if (!agentId) {
        alert('Please add REACT_APP_ELEVENLABS_AGENT_ID to your .env file');
        setStatus('Missing Agent ID');
        return;
      }

      console.log('üöÄ Starting conversation with agent:', agentId);

      await conversation.startSession({
        agentId: agentId,
      });

      setStatus('Connected - Listening...');
    } catch (error) {
      console.error('Failed to start conversation:', error);
      setStatus(`Failed: ${error.message}`);
      alert('Failed to start conversation. Check console for details.');
    }
  };

  const endConversation = async () => {
    try {
      setStatus('Disconnecting...');
      await conversation.endSession();
      setStatus('Disconnected');
    } catch (error) {
      console.error('Failed to end conversation:', error);
      setStatus('Error ending conversation');
    }
  };

  return (
    <div style={styles.container}>
      <div style={styles.header}>
        <h3 style={styles.title}>üé§ Voice Interface</h3>
        <div style={styles.status}>
          <span style={{
            ...styles.statusDot,
            backgroundColor: isConnected ? '#10b981' : '#ef4444'
          }}></span>
          <span style={styles.statusText}>
            {status}
          </span>
        </div>
      </div>

      <div style={styles.controls}>
        {!isConnected ? (
          <button
            onClick={startConversation}
            style={{...styles.button, ...styles.startButton}}
            disabled={conversation.status === 'connecting'}
          >
            {conversation.status === 'connecting' ? 'Connecting...' : 'Start Conversation'}
          </button>
        ) : (
          <button
            onClick={endConversation}
            style={{...styles.button, ...styles.endButton}}
          >
            End Conversation
          </button>
        )}
      </div>

      <div style={styles.info}>
        <p style={styles.infoText}>
          {isConnected 
            ? 'üéôÔ∏è Microphone is active. Say "generate a function to..." or "create code for..."'
            : 'Click "Start Conversation" and allow microphone access to begin'}
        </p>
        <p style={styles.debugText}>
          Connection Status: {conversation.status || 'idle'}
        </p>
      </div>
    </div>
  );
};

const styles = {
  container: {
    padding: '20px',
    backgroundColor: '#1e1e1e',
    borderRadius: '8px',
    color: '#fff',
  },
  header: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: '20px',
  },
  title: {
    margin: 0,
    fontSize: '20px',
    fontWeight: '600',
  },
  status: {
    display: 'flex',
    alignItems: 'center',
    gap: '8px',
  },
  statusDot: {
    width: '10px',
    height: '10px',
    borderRadius: '50%',
  },
  statusText: {
    fontSize: '14px',
  },
  controls: {
    marginBottom: '20px',
  },
  button: {
    padding: '12px 24px',
    fontSize: '16px',
    fontWeight: '600',
    border: 'none',
    borderRadius: '6px',
    cursor: 'pointer',
    transition: 'all 0.2s',
    width: '100%',
  },
  startButton: {
    backgroundColor: '#10b981',
    color: '#fff',
  },
  endButton: {
    backgroundColor: '#ef4444',
    color: '#fff',
  },
  info: {
    padding: '16px',
    backgroundColor: '#2d2d2d',
    borderRadius: '6px',
  },
  infoText: {
    margin: '0 0 8px 0',
    fontSize: '14px',
    color: '#a0a0a0',
  },
  debugText: {
    margin: 0,
    fontSize: '12px',
    color: '#666',
    fontFamily: 'monospace',
  },
};

export default VoiceInterface;
